import {useState} from 'react';
import {Container, Row, Col } from 'react-bootstrap';
import 'bootstrap/dist/css/bootstrap.min.css';
import rocked from '../imgs/rocket.svg'

export default function Banner() {
  return (
    <section id="banner">
      <Container>
        <Row>
          <Col lg={6}>
            banner text
          </Col>
          <Col lg={6}>
            banner image
          </Col>
        </Row>
      </Container>
    </section>
  )
}
